import React from "react";

export default function Synonyms(props) {
  console.log(props.synonyms.synonyms);
  if (props.synonyms) {
    return (
      <p>
        <strong>Synonyms: </strong>
        {props.synonyms.synonyms}
      </p>
    );
  } else {
    return null;
  }
}
